import React, { useState, useEffect } from 'react';

function AddPhoneData() {
  const [phoneData, setPhoneData] = useState([]);
  const [latitude, setLatitude] = useState('');
  const [longitude, setLongitude] = useState('');

  useEffect(() => {
    getPhoneData();
  }, []);

  const getPhoneData = async () => {
    try {
      const res = await fetch('http://localhost:3001/phoneData');
      const data = await res.json();
      setPhoneData(data);
    } catch (error) {
      console.error('Error fetching phone data:', error);
    }
  };

  const addPhoneData = async (e) => {
    e.preventDefault();
    try {
      await fetch('http://localhost:3001/phoneData', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ latitude, longitude })
      });
      setLatitude('');
      setLongitude('');
      getPhoneData();
    } catch (error) {
      console.error('Error adding phone data:', error);
    }
  };

  return (
    <div>
      <h3>Photos:</h3>
      <ul>
        {phoneData.map((item) => (
          <li key={item._id}>
            Latitude: {item.latitude}, Longitude: {item.longitude}
          </li>
        ))}
      </ul>

      <form onSubmit={addPhoneData}>
        <label>
          Latitude:
          <input
            type="number"
            value={latitude}
            onChange={(e) => setLatitude(e.target.value)}
            required
          />
        </label>
        <br />
        <label>
          Longitude:
          <input
            type="number"
            value={longitude}
            onChange={(e) => setLongitude(e.target.value)}
            required
          />
        </label>
        <br />
        <button type="submit">Add Phone Data</button>
      </form>
    </div>
  );
}

export default AddPhoneData;
